import React,{useState} from "react";
import { useNavigate } from "react-router";
import "./childComponents.css";

const FORM_STAGES = {
    PAGEONE: "pageone",
    PAGETWO: "pagetwo",
    PAGETHREE: "pagethree",
    PAGEFOUR: "pagefour",
    PAGEFIVE: "pagefive",
    // PAGESIX: "pagesix",
    // PAGEONE: "pageone",
    // PAGEONE: "pageone",
    // PAGEONE: "pageone",

}

const MiniQuizHome = ({node}) => {

    const [currentNode,setCurrentNode] = useState(node);
    const navigate = useNavigate();

    const handleAnswer = (answer) =>{
        setCurrentNode(answer.next);
    }
    if (currentNode.result){
        return
    }

    return (
        <>
        <div>
        <button onClick={(e) => navigate("/") } className="back-button">Back</button>
        {FORM_STAGES.PAGEONE && (
        <div>
        <h1 className="mini-quiz-question">
        Question 1
        </h1>
        </div>
        )}
        {FORM_STAGES.PAGETWO && (
        <div>
        <h1 className="mini-quiz-question">
        Question 2
        </h1>
        </div>
        )}
        {FORM_STAGES.PAGETHREE && (
        <div>
        <h1 className="mini-quiz-question">
        Question 3
        </h1>
        </div>
        )}
        {FORM_STAGES.PAGEFOUR && (
        <div>
        <h1 className="mini-quiz-question">
        Question 4
        </h1>
        </div>
        )}
        {FORM_STAGES.PAGEFIVE && (
        <div>
        <h1 className="mini-quiz-question">
        Question 5
        </h1>
        </div>
        )}

        </div>
        </>
    )
}

export default MiniQuizHome;
